query:
/*+  */ select count(*)
from movie_companies AS mc
inner join title AS t
on t.id = mc.movie_id AND mc.company_id > 113375 AND mc.company_type_id = 2 AND t.kind_id = 3 AND t.production_year > 2008
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id < 2901784 AND ci.role_id < 10;
